import React, { Component } from "react";
import { View, Text, StyleSheet } from "react-native";
import { Input, Button } from '../../components';


export default class HomeAdminitrador extends Component {
    constructor(props:any) {
        super(props);
    }

    render(){
        return (
            <View style={style.container}>
                <View style={style.containertitulo}>
                    <Text style={style.titulo}>ADMINISTRADOR</Text>
                </View>
                <View style={style.containerButton}>
                    <Button
                        title="Gestión de Cursos"
                        onPress={this.NavigateCurso}
                    />
                    <Button
                        title="Gestión de Docentes"
                        onPress={this.NavigateDocente}
                    />
                    <Button
                        title="Gestión de Estudiantes"
                        onPress={this.NavigateEstudiante}
                    />
                </View>
            </View>
        ); 
    }

    NavigateCurso=()=>{
        this.props.navigation.navigate('GestionCurso');
    }

    NavigateDocente=()=>{
        this.props.navigation.navigate('GestionDocente');
    }
    NavigateEstudiante=()=>{
        this.props.navigation.navigate('GestionCurso');
    }
}

const style = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'flex-start',
        alignItems: 'center',
        backgroundColor: 'white'
    },
    containertitulo: {
        height: '15%',
        justifyContent: 'center',
    },
    titulo: {
        fontSize: 25,
        color : 'black',
        fontWeight: 'bold',
    },
    containerButton: {
        justifyContent: 'space-evenly',
        flex: 1
    },
})
